                    <label for="exampleFormControlSelect1">{{ vitalQuestion.title }}</label><br>
                    <input class="form-control d-inline w-25 mr-2" type="number" min="0" v-model="vitalQuestion.value" value="0"> {{ vitalQuestion.caption }}
